      {children}
    </StyledMain>

  </StyledPage>
)

const StyledPage = styled.div`
dis
`

const StyledMain = styled.div`
  align-items: center;
  display: flex;
  flex-direction: column;
  /* min-height: calc(100vh - ${props => props.theme.topBarSize * 2}px); */
  /* padding-bottom: ${props => props.theme.spacing[5]}px; */
`

